import React from "react";

function Img({url, imgRef, canvasRef}){
    return(
        <div style={{display: 'flex',justifyContent: "center"}}>
       <img ref={imgRef} 
      crossOrigin="anonymous"
      src="https://images.pexels.com/photos/712513/pexels-photo-712513.jpeg?auto=compress&cs=tinysrgb&w=600"
      alt="image" 
      style={{width: '440px', height: '500px'}}
      />
      <canvas ref={canvasRef} 
      style={{width: '440', height: '500px', position: "absolute"}}>
      </canvas>
      
       </div>
    )
}

export default Img;
